import { useEffect, useState } from "react";

const Pagination = ({ totalPages, setCurrentPage }) => {
  const [list, setList] = useState([]);

  useEffect(() => {
    const arr = [];
    for (let i = 1; i < totalPages.length; i++) {
      arr.push[i];
    }
    setList(arr);
  }, []);

  return <div>{list}</div>;
};

export default Pagination;
